import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";


function Login() {
  return (
    <div>
    <h1 className="customer-heading">Uber <span className="heading-eats">Eats</span></h1>
    <h1 className="form-floating">Welcome Back!</h1>
    <div class="form-floating">
     <input type="email" class="form-control" id="floatingInput" placeholder="name@example.com" name="email" />
     <label for="floatingInput">Sign in with your email address</label>
    </div>
    <div class="form-floating mb-3">
     <input type="password" class="form-control" id="floatingPassword" placeholder="Password" name="password"  />
     <label for="floatingPassword">Password</label>
     </div>
     <div class="d-grid gap-2 form-floating">
     <button type="button" class="btn btn-outline-primary">Continue</button>
     </div>
     <h4>New to Uber? Want to signup your Restaurant with Uber?<span><a href="./CustomerLogin">Create an account</a></span></h4>
     <h4>New to Uber? Want to signup your Restaurant with Uber?<span><a href="">Create an account</a></span></h4>
    </div>
  );
}

export default Login;
